import React from "react";
import Header from "./header";
import image from '../resources/fallback.svg';

export default class Fallback extends React.Component{
    render(){
        return(
            <>
                <Header/>
                <div id="fallback">
                    <img src={image} alt="Oops... Something went wrong!" />
                    <div id="fallbackParaph">
                        <p>Oops... Something went wrong. Seems nothing here now.<br>Let's get you back!</br></p>
                    </div>
                </div>
            </>
        )
    }
}
